import ExpenseItem from './components/ExpenseItem/ExpenseItem';
import * as S from './Expense.style';
import Card from '../Card/Card';

const Expense = (props) => {
    const { expenses } = props;
    return (
        <Card>
        <S.ExpenseWrapper>
          {expenses.map(expense => (
            <ExpenseItem 
              title={expense.title}
              amount={expense.amount}
              date={expense.date}
            />
          ))}
        </S.ExpenseWrapper>
        </Card>
    );
}

export default Expense;
